After inverting the terminal‐productions you find

NT11 ⇒ {t1, t21, t14, t3, t16, t9, t2, t15, t7, t10, t0, t18, t8, t19}  
NT32 ⇒ {t11, t5, t3, t6, t21, t13, t10, t17, t14, t18}

Neither NT11 nor NT32 ever produce “t4.” But both of S’s productions end in exactly one occurrence of NT11 or NT32, so the final terminal of any S‐derivation must come from one of those two nonterminals. In particular no S‐derivation can end in t4. Hence the string ending in t4 cannot be generated.

